import './List.css';
import NewPeople from '../New/Main';
import { list, list1, list2, list3 } from './ListMember';


// viewer list Member recently
export default function Returnlist() {
 return (
  <div className='wrp-list-admin'>

   <NewPeople />

   <ul>
    {[...list].map((index) => {
     return (
      <li>{index}</li>
     )
    })}

   </ul>

   <ul>
    {[...list1].map((index) => {
     return (
      <li>{index}</li>
     )
    })}
   </ul>

   <ul>
    {[...list2].map((index) => {
     return (
      <li>{index}</li>
     )
    })}
   </ul>

   <ul>
    {[...list3].map((index) => {
     return (
      <li>{index}</li>
     )
    })}
   </ul>



  </div>
 );
};
